import './App.css';
import Logo from './Bilder/Logo.png'; 

function App() {
  return (
    <div className="App">
      <header className="top-bar">
<img src={Logo} alt="Logo" className='Logo-Img'/>
        <div className="top-bar-title">



        </div>

        <div className="top-bar-items">
        </div>
      </header>
    </div>
  );
}

export default App;
